import "./App.css";
import React, { useEffect, useState } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faArrowsRotate, faBus, faTrain } from "@fortawesome/free-solid-svg-icons";
import Forsinkelse from "./components/Forsinkelse";

function App() {
  const [forsinkelser, setForsinkelser] = useState([]);

  async function test() {
    fetch("http://localhost:3001/forsinkelser")
      .then((res) => res.json())
      .then((data) => {
        setForsinkelser(data);
      });
  }

  test();

  return (
    <div className="App">
      <div className="header">
        <input className="search" type="text"></input>
        <FontAwesomeIcon icon={faArrowsRotate}></FontAwesomeIcon>
      </div>
      {forsinkelser.map((forsinkelse) =>
        forsinkelser.sort((a, b) => {
          return new Date(b.aimedTime) - new Date(a.aimedTime);
        })
      )}
    </div>
  );
}

export default App;
